            <div id="titleDiv">
                <span>P</span>
                <span>E</span>
                <span>R</span>
                <span>I</span>
                <span>O</span>
                <span>D</span>
                <span>I</span>
                <span>C</span>

                <span>T</span>
                <span>A</span>
                <span>B</span>
                <span>L</span>
                <span>E</span>

                <span>O</span>
                <span>F</span>

                <span>E</span>
                <span>L</span>
                <span>E</span>
                <span>M</span>
                <span>E</span>
                <span>N</span>
                <span>T</span>
                <span>S</span>
            </div>
        );
    }
}


export default Title
